export function add41(a: number, b: number): number {
  return a + b;
}

export function subtract41(a: number, b: number): number {
  return a - b;
}

export function multiply41(a: number, b: number): number {
  return a * b;
}

export function divide41(a: number, b: number): number {
  return a / b;
}
